import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import MastarLayout from "./layouts/admin/MastarLayout";
// import MasterLayout from "./layouts/admin/MastarLayout";
function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route path="/admin/dashboard" component={MastarLayout} />
        </Switch>
      </Router>
    </div>
  );
}

export default App;
